Endo! 😉 Root canal therapy is a treatment for removing infection from inside a tooth! 😃 It also protect the tooth from future infections! The dentist will remove everything inside a root canal. Then he cleans and shape it using tiny files! He can then fill it with a rubber-like material, and a special cement to seal all the canals!😷
